import React from "react";
import { Button, View } from "react-native";


export default function SearchBar({ setQuery }) {
  return (
    <View
      style={{
        padding: 10,
        backgroundColor: "#ffffff",
        margin: 10,
        borderRadius: 30,
        borderWidth: 1,
        borderColor: "#BA181B",
      }}
    >
      <Button onChangeText={(value) => setQuery(value)}> UrgentList</Button>
    </View>
  );
}
